import { mockData } from "../utils/mockData";
import Client from "./client";

const ClientSlide=() =>{
return (
    <div>
        {mockData.map((card) => (
            <Client
             key={card.id}
             image={card.Image}
             quoteIcon={card.quoteIcon}
             para={card.para}
             name={card.name}
             title={card.title}
            />
          ))}
</div>
)
}
export default ClientSlide;
